// chart options

// usage: vertical bar or line
function vertical_option_basic(beginAtZero) {
  return {
    responsive: true,
    scales: {
      yAxes: [{
        ticks: {
          beginAtZero: beginAtZero
        }
      }]
    }
  };
}

function vertical_option(y_label, y_value, y_symbol, beginAtZero) {
  return {
    responsive: true,
    scales: {
      yAxes: [{
        ticks: {
          beginAtZero: beginAtZero,
          callback: function(label, index, labels) {
            return label/y_value + y_symbol;
          }
        },
        scaleLabel: {
          display: true,
          labelString: y_label
        }
      }]
    },
    tooltips: {
      callbacks: {
        label: function(tooltipItem, data) {
          var dataset = data.datasets[tooltipItem.datasetIndex];
          return add_comma(dataset.data[tooltipItem.index], 0);
        }
      }
    }
  };

}

// usage: horizontal bar
function horizontal_bar_option(x_label, x_value, x_symbol) {
  return {
    scales: {
      xAxes: [{
        ticks: {
          callback: function(label, index, labels) {
            return label/x_value + x_symbol;
          }
        },
        scaleLabel: {
          display: true,
          labelString: x_label
        }
      }]
    },
    tooltips: {
      callbacks: {
        label: function(tooltipItem, data) {
          return add_comma(tooltipItem.xLabel, 0);
        }
      }
    }
  };
}


// usage: vertical stacked bar
function vertical_stacked_bar_option(y_label, y_value, y_symbol, num) {
  return {
    responsive: true,
    scales: {
      xAxes: [{
        stacked: true
      }],
      yAxes: [{
        stacked: true,
        ticks: {
          callback: function(label, index, labels) {
            return label/y_value + y_symbol;
          }
        },
        scaleLabel: {
          display: true,
          labelString: y_label
        }
      }]
    },
    tooltips: {
      callbacks: {
        label: function(tooltipItem, data) {
          var dataset = data.datasets[tooltipItem.datasetIndex];
          var total = data.datasets[num].data[tooltipItem.index];

          var currentValue = dataset.data[tooltipItem.index];
          var commaValue = add_comma(dataset.data[tooltipItem.index], 0);
          var precentage = Math.floor( ((currentValue/total) * 100) + 0.5 );
          return commaValue + " (" + precentage + "%)";
        }
      }
    }
  };
}


// usage: pie
function pie_option() {
  return {
    tooltips: {
      callbacks: {
        label: function(tooltipItem, data) {
          var dataset = data.datasets[tooltipItem.datasetIndex];
          var total = dataset.data.reduce(function(previousValue, currentValue, currentIndex, array) {
            return previousValue + currentValue;
          });
          var currentValue = dataset.data[tooltipItem.index];
          var commaValue = add_comma(dataset.data[tooltipItem.index], 0);
          var precentage = Math.floor(((currentValue/total) * 100) + 0.5);
          return commaValue + " (" + precentage + "%)";
        }
      }
    }
  };
}



// usage: bubble
function bubble_option(x_label, x_value, x_symbol, y_label, y_value, y_symbol) {
  return {
    elements: {
      points: {
        borderWidth: 1,
        borderColor: 'rgb(0, 0, 0)'
      }
    },
    scales: {
      xAxes: [{
        ticks: {
          callback: function(label, index, labels) {
            return label/x_value + x_symbol;
          }
        },
        scaleLabel: {
          display: true,
          labelString: x_label
        }
      }],
      yAxes: [{
        ticks: {
          callback: function(label, index, labels) {
            return label/y_value + y_symbol;
          }
        },
        scaleLabel: {
            display: true,
            labelString: y_label
         }
       }]
    }
  };

}

// usage: radar
function radar_option() {
  return {
    scale: {
      reverse: true,
      ticks: {
        beginAtZero: true
      }
    }
  };
}

// usage: polar area
function polar_area_option() {
  return {
    elements: {
      arc: {borderColor: "#fff"}
    }
  };
}


// Helper function
function add_comma(num, precision) {
  return Number(num).toFixed(precision).replace(/./g, function(c, i, a) {
    return i > 0 && c !== "." && (a.length - i) % 3 === 0 ? "," + c : c;
  });
}
